import React, { Component } from "react";
import App from "../App";

class Panel extends Component {
  constructor() {
    const spanStyle = {
      color: "blue"
    };
  }

  render() {
    return (
      <div className="project-panel" style={spanStyle}>
        Content
      </div>
    );
  }
}

export default Panel;
